import React, { Component } from 'react';

import {
  Link
} from "react-router-dom";

class CaptionListHeader extends Component {
  render() {
    return (
      <div className="CaptionActionsMainContainer">
        <div
          className="CaptionActionsButton CaptionActionsButtonBottomMargin"
          onClick={() => alert('Creating card')}
          >
          Create Caption Card
        </div>
      </div>
    );
  }
}

export default CaptionListHeader;
